//Icons for the buttons parsed as strings
var ButtonIcons = {
	reset : "",
	import : "",
	textsize : "",
	automanual : "",
	weight : "",
	scores : "",
	modifiers : "",
	spells : "",
	league : "",
	print : "",
	tablet : "",
	unitsystem : "",
	colors : "",
	faq : "",
	layout : "",
	sources : "",
	classes : ""
};

// create icon streams that can be used directly
var allIcons = {};
function CreateIcons() {
	for (var aIcon in ButtonIcons) {
		allIcons[aIcon] = {
			name : aIcon,
			count : 0,
			width : 20,
			height : 20,
			read : function (nBytes) {
				theReturn = ButtonIcons[this.name].slice(this.count, this.count += nBytes);
				if (this.count >= 131072) this.count = 0;
				return theReturn;
			}
		};
	};
};